import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
import orange_logo from "../../resources/footer_logo1.svg";
import green_logo from "../../resources/footer_logo2.svg";
import phone from "../../resources/phone.svg";
import message from "../../resources/message.svg";
import instagram from "../../resources/instagram.svg";
import telegram from "../../resources/telegram.svg";
import whatsapp from "../../resources/whatsapp.svg";

function ContactsMenu() {
	return (
		<Wrapper className="footer_menu">
			<div className="footer_menu-header">
				<h4 className="footer_menu-title title">КОНТАКТЫ</h4>
			</div>

			<div className="footer-menu-container">
        <div className="footer_menu-container-left">
					<div className="footer_menu-items">
            <img
              src={ orange_logo }
              alt="orange colored co. logo"
              className="footer_menu-item"
            />
            <img
              src={ green_logo }
              alt="green colored co. logo"
              className="footer_menu-item"
            />
          </div>

					<div className="footer_menu-items">
            <Link to="/" className="footer_menu-item">
              <img
								src={ instagram }
								alt="instagram link"
              	className="footer_menu-icon"
							/>
            </Link>

            <Link to="/" className="footer_menu-item">
              <img
								src={ telegram }
								alt="telegram link"
              	className="footer_menu-icon"
							/>
            </Link>

						<Link to="/" className="footer_menu-item">
              <img
								src={ whatsapp }
								alt="telegram link"
              	className="footer_menu-icon"
							/>
            </Link>
          </div>
				</div>

        <div className="footer_menu-container-right">
					<Link to="/" className="footer-menu-item">
						<img
							src={ phone }
							alt="phone icon"
							className="footer_menu-icon"
						/>
						<p className="footer_menu-text" >+7 775 656 48 27</p>
					</Link>
					<Link to="/" className="footer-menu-item">
						<img
							src={ phone }
							alt="phone icon"
							className="footer_menu-icon"
						/>
						<p className="footer_menu-text" >+7 701 135 41 46</p>
					</Link>
					<Link to="/" className="footer-menu-item">
						<img
							src={ message }
							alt="message icon"
							className="footer_menu-icon"
						/>
						<p className="footer_menu-text" >yakastana@gmail.com</p>
					</Link>
				</div>
      </div>
    </Wrapper>
	);
}

const Wrapper = styled.ul`
	.footer-menu-container {
		display: flex;
		justify
		align-items: center;
	}

	.footer_menu-items:first-child .footer_menu-item {
		height: 3.125em;
		margin-right: .75vw;
	}

	.footer_menu-items:last-child {
		display: flex;
		align-items: center;
		gap: 1.25vw;
		margin-top: 1.25em;
	}

	.footer_menu-items:last-child .footer_menu-item {
		display: flex;
		align-items: center;
		justify-content: center;
		width: 2.5em;
		height: 2.5em;
		border: 1px solid var(--clr-white);
		border-radius: 50%;
	}
`;

export default ContactsMenu;
